import totalToRender from "../profileTotal/totalToRender"
import ProfileListItem from "./profileListItem"


export default function renderProfileList(value, totalToRenderNumber, focused, setFocused) {
  return totalToRender(value, totalToRenderNumber).map((item, i) => (
    <ProfileListItem 
      key={`ListItem${i}`} 
      data={item}
      focused={focused} 
      setFocused={setFocused}/>
  ))
}
